import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "./notes";
var React=require("react");

function App(){
    return (<div>
        <Header></Header>
        {notes.map(noteItem => (
        <Note
          key={notes.key}
          title={notes.title}
          content={notes.content}
        />
      ))}
        <Footer></Footer> 
    </div>);
}
export default App;
